pragma solidity >= 0.7.0 <0.9.0;

contract notbitcoin {

    int public ViewProfits;

    constructor(int userImput) {
        ViewProfits = userImput;
    }


    function buy() public {
        ViewProfits += 1;
    }


    function refund() public {

        ViewProfits -= 1;
    }
}

